import React from 'react'

function Content() 
{
 
    return (
      <div class="row">
        <div class="sidebuttons col col-1 col-md-1">
        </div>
        <div class="content">
          <h1 class="graphpagetitle col-5 col-md-5"> <b> Content </b></h1>
        </div>
        <div class="sidebuttons col col-1 col-md-1">
        </div>
      </div>);

}

export default Content;
